import React from 'react';
import './index.css';
import logo from '../Navbar/BBLogo.jpg';

function Header() {
   return (
      <div>
         <img src={logo} alt="logo" height="75" width="75"/>
         <h1 className="header">
            BrainBox
         </h1>
      </div>
   );
}

export default Header;
